Arrays
Un array es una lista de valores.
Para asignar valores a un array encerramos los elementos entre corchetes ( array literal notation )Los elementos de un array son indexados con números consecutivos a partir de 0Para acceder a un elemento del array especificamos el índice entre corchetes
var a = [1,2,3];
>>> a[0]
1
>>> a[1]
2

Podemos declarar un array vacio asi: var a = [];
Para añadir/actualizar un elemento del array:
>>> a[2] = 'three';
"three"
>>> a
[1, 2, "three"]
>>> a[3] = 'four';
"four"
>>> a
[1, 2, "three", "four"]

Para eliminar un elemento del array podemos utilizar el operador delete:
>>> var a = [1, 2, 3];
>>> delete a[1];
true
>>> a
[1, undefined, 3]

Un array puede contener otros arrays.
>>> var a = [1, "two", false, null, undefined];
>>> a
[1, "two", false, null, undefined]
>>> a[5] = [1,2,3]
[1, 2, 3]
>>> a
[1, "two", false, null, undefined, [1, 2, 3]]

>>> var a = [[1,2,3],[4,5,6]];
>>> a
[[1, 2, 3], [4, 5, 6]]
>>> a[0]
[1, 2, 3]
>>> a[0][0]
1
>>> a[1][2]
6

